def rankings_to_latex(datasets, table, max_is_better=True, scale=1, precision=3,
             table_size="normalsize", caption="", label='table',
             add_std=True, position='tph', column_names=None,
             avg_ranks=None, add_rank=True):
    if column_names is None:
        column_names = table.columns.levels[2]
    n_columns = len(column_names)
    row_names = table.index
    n_rows = len(row_names)

    means = table.values[:, :n_columns].copy()*scale
    computed_avg_ranks = np.zeros(n_columns)
    stds = table.values[:, n_columns:]*scale
    str_table = ("\\begin{table}[" + position + "]\n" +
                 "\\" + table_size + "\n" +
                 "\\centering\n")
    str_columns = "l"
    str_header = ""

    for c_name in column_names:
        str_columns += "c"
        str_header += " & " + c_name.replace('_', r'\_')
    str_header += "\\\\\n"

    str_table += ("\\begin{tabular}{"+str_columns+"}\n" +
                  "\\toprule\n" +
                  str_header +
                  "\\midrule\n")
    for i, name in enumerate(row_names):
        name = name[:10] if len(name) > 10 else name
        name = name.replace("_", r"\_")
        str_row_means = name
        v = means[i]
        v_std = stds[i]
        indices = rankdata(v)
        if max_is_better:
            indices = n_columns + 1 - indices
        for j in np.arange(len(v)):
            idx = indices[j]
            computed_avg_ranks[j] += idx / n_rows
            if idx == 1:
                str_row_means += (" & $\\mathbf{{{0:.{1}f}".format(
                                    v[j], precision))
                if add_std:
                    str_row_means += ("\\pm{0:.{1}f}".format( v_std[j],
                                                             precision))
                if add_rank:
                    str_row_means += ("_{{{0}}}".format(1))
                str_row_means += "}$"

            else:
                idx_s = "{}".format(idx)
                if ".0" in idx_s:
                    idx_s = "{}".format(int(idx))
                str_row_means += (" & ${0:.{1}f}".format( v[j], precision))
                if add_std:
                    str_row_means += ("\\pm{0:.{1}f}".format( v_std[j],
                                                             precision))

                if add_rank:
                    str_row_means += ("_{{{0}}}".format(idx_s))
                str_row_means += "$"
        str_table += str_row_means + "\\\\\n"
    str_table += "\\midrule\n"
    str_avg = "avg rank"
    if avg_ranks is None:
        avg_ranks = computed_avg_ranks
    for i in np.arange(n_columns):
        if avg_ranks[i] == min(avg_ranks):
            str_avg += " & \\bf{{{0:.2f}}}".format(avg_ranks[i])
        else:
            str_avg += " & {0:.2f}".format(avg_ranks[i])

    str_table += (str_avg + "\\\\\n" +
                  "\\bottomrule\n" +
                  "\\end{tabular}\n" +
                  "\\normalsize\n" +
                  "\\caption{"+caption+"}\n" +
                  "\\label{"+label+"}\n" +
                  "\\end{table}\n")
    return str_table


def p_value(values):
    if values.shape[1] > 2:
        return friedmanchisquare(*[values[:, x] for x in np.arange(
                                                      values.shape[1])])
    else:
        return wilcoxon(values[:, 0], values[:, 1])


def beta_nll(param, *args):
    """
    Negative log likelihood function for beta
    <param>: list of parameters to be fitted.
    <args>: 1-element array containing the sample data.

    Return <nll>: negative log-likelihood to be minimized.
    """
    a, b = param
    data = args[0]
    pdf = beta.pdf(data, a, b, loc=0, scale=1)
    lg = np.log(pdf)
    mask = np.isfinite(lg)
    nll = -lg[mask].sum()
    return nll


def fit_beta_nll(data):
    result = fmin(beta_nll, [1, 1], args=(data,))
    alpha, bt = result
    return alpha, bt


def fit_beta_midpoint(prior_pos, alpha_pos, beta_pos, prior_neg, alpha_neg,
                      beta_neg):
    m = minimize_scalar(
        lambda mh: np.abs(beta.pdf(mh, alpha_pos, beta_pos) * prior_pos -
                          beta.pdf(mh, alpha_neg, beta_neg) * prior_neg),
        bounds=[0, 1], method='Bounded').x
    return m


def fit_beta_moments(scores):
    mean = scores.mean()
    var = np.clip(np.var(scores, ddof=1), 1e-16, np.inf)
    mult = (((mean * (1.0 - mean)) / var) - 1)
    alpha = mean * mult
    bt = (1.0 - mean) * mult
    return alpha, bt


def beta_test_old(scores, labels, n_curves=100, alpha=0.05, percent_labels=0.5):
    n_changed = int(percent_labels * len(labels))
    idx_min = np.round((alpha / 2.0) * n_curves)
    idx_max = np.round((1 - (alpha / 2.0)) * n_curves)

    a = np.zeros(n_curves)
    b = np.zeros(n_curves)
    m = np.zeros(n_curves)

    for i in np.arange(n_curves):
        new_labels = _draw_new_labels(scores, labels, n_changed)
        calibrator = BetaCalibration(parameters="abm").fit(scores, new_labels)
        a[i] = calibrator.calibrator_.map_[0]
        b[i] = calibrator.calibrator_.map_[1]
        m[i] = calibrator.calibrator_.map_[2]

    a = np.sort(a)
    b = np.sort(b)
    m = np.sort(m)

    return {'a': (a[idx_min], a[idx_max]),
            'b': (b[idx_min], b[idx_max]),
            'm': (m[idx_min], m[idx_max])}


def _get_curve(scores, labels, alpha=0):
    bins = np.linspace(0, 1, 11)
    hist_tot = np.histogram(scores, bins=bins)
    hist_pos = np.histogram(scores[labels == 1], bins=bins)
    centers = (bins[:-1] + bins[1:])/2.0
    idx = hist_tot[0] > 0
    centers = centers[idx]
    hist_pos = hist_pos[0][idx]
    hist_tot = hist_tot[0][idx]
    empirical_p = np.true_divide(hist_pos + alpha, hist_tot + 2 * alpha)
    return centers, empirical_p


def _draw_new_labels(scores, labels, n_changed):
    changed = np.random.choice(len(labels), n_changed, replace=False)
    new_labels = np.copy(labels)
    for idx in changed:
        new_labels[idx] = np.random.binomial(1, scores[idx])
    return new_labels


def _analytical_difference(beta_map):
    a = beta_map[0]
    b = beta_map[1]
    m = beta_map[2]
    c = b * np.log(1.0 - m) - a * np.log(m)
    f = lambda s: np.abs(s - (1 / (1 + (1/((np.exp(c)) * (s**a)/((1-s)**b))))))
    return integrate.quad(f, 0, 1)[0]


def _mean_absolute_difference(scores, beta_map):
    a = beta_map[0]
    b = beta_map[1]
    m = beta_map[2]
    c = b * np.log(1.0 - m) - a * np.log(m)
    calibrated = 1 / (1 + (1/((np.exp(c)) * (scores**a)/((1-scores)**b))))
    return np.mean(np.abs(scores - calibrated))


def _draw_labels(scores):
    return np.array([np.random.binomial(1, p) for p in scores])


def beta_test_2(scores, labels, scores_test, y_test, n_curves=100, alpha=0.05):
    idx_min = 0  # np.round((alpha / 2.0) * n_curves)
    idx_max = np.round((1 - alpha) * n_curves)  # np.round((1 - (alpha
    #  / 2.0)) * n_curves)
    if idx_max >= n_curves:
        idx_max = n_curves - 1

    ll_before = cross_entropy(scores_test, y_test)
    brier_before = brier_score(scores_test, y_test)

    calibrator = BetaCalibration(parameters="abm").fit(scores, labels)

    ll_after = cross_entropy(calibrator.predict(scores_test), y_test)
    brier_after = brier_score(calibrator.predict(scores_test), y_test)

    original_map = calibrator.calibrator_.map_
    ad = _analytical_difference(original_map)
    mad = _mean_absolute_difference(scores, original_map)

    ad_evenly = np.append(np.zeros(n_curves), [1.0])
    ad_actual = np.append(np.zeros(n_curves), [1.0])
    mad_evenly = np.append(np.zeros(n_curves), [1.0])
    mad_actual = np.append(np.zeros(n_curves), [1.0])

    evenly_spaced = np.linspace(0, 1, len(scores))
    for i in np.arange(n_curves):
        labels_evenly = _draw_labels(evenly_spaced)
        labels_actual = _draw_labels(scores)
        evenly = BetaCalibration(parameters="abm").fit(evenly_spaced,
                                                       labels_evenly)
        evenly_map = evenly.calibrator_.map_
        actual = BetaCalibration(parameters="abm").fit(scores, labels_actual)
        actual_map = actual.calibrator_.map_
        ad_evenly[i] = _analytical_difference(evenly_map)
        ad_actual[i] = _analytical_difference(actual_map)
        mad_evenly[i] = _mean_absolute_difference(evenly_spaced, evenly_map)
        mad_actual[i] = _mean_absolute_difference(scores, actual_map)

    ad_evenly = np.sort(ad_evenly)
    ad_actual = np.sort(ad_actual)
    mad_evenly = np.sort(mad_evenly)
    mad_actual = np.sort(mad_actual)

    return {
        "ad": ad,
        "mad": mad,
        "ad_evenly": (ad_evenly[idx_min], ad_evenly[idx_max]),
        "ad_actual": (ad_actual[idx_min], ad_actual[idx_max]),
        "mad_evenly": (mad_evenly[idx_min], mad_evenly[idx_max]),
        "mad_actual": (mad_actual[idx_min], mad_actual[idx_max]),
        "p_ad_evenly": 1.0 - percentileofscore(ad_evenly, ad,
                                               kind="strict")/100,
        "p_ad_actual": 1.0 - percentileofscore(ad_actual, ad,
                                               kind="strict")/100,
        "p_mad_evenly": 1.0 - percentileofscore(mad_evenly, mad,
                                                kind="strict")/100,
        "p_mad_actual": 1.0 - percentileofscore(mad_actual, mad,
                                                kind="strict")/100,
        "ll_diff": ll_after - ll_before,
        "bs_diff": brier_after - brier_before
    }


def gamma_pdf(x, k, theta):
    return (x**(k-1) * np.exp(-x/theta)) / (gamma_func(k)*theta**k)


def gamma_cdf(x, k, theta):
    return gamma.cdf(x / theta, k)


def adev_test(scores, calibration_map, alpha=0.05):
    idx_max = np.round((1 - alpha) * len(beta_areas))
    ad = _analytical_difference(calibration_map)
    theta = 1.0 / np.sqrt(91.0 * np.alen(scores))
    return {
        "statistic": ad,
        "interval": (beta_areas[0], beta_areas[idx_max]),
        "p-value": 1.0 - gamma_cdf(ad, 4.84, theta)
        # "p-value": 1.0 - percentileofscore(beta_areas, ad,
        #                                        kind="strict")/100
    }


def madac_test(scores, calibration_map, n_curves=100, alpha=0.05):
    idx_max = np.round((1 - alpha) * n_curves)
    if idx_max >= n_curves:
        idx_max = n_curves - 1

    mad = _mean_absolute_difference(scores, calibration_map)

    mad_actual = np.append(np.zeros(n_curves), [1.0])

    for i in np.arange(n_curves):
        labels_actual = _draw_labels(scores)
        while len(np.unique(labels_actual)) < 2:
            labels_actual = _draw_labels(scores)
        actual = BetaCalibration(parameters="abm").fit(scores, labels_actual)
        actual_map = actual.calibrator_.map_
        mad_actual[i] = _mean_absolute_difference(scores, actual_map)

    mad_actual = np.sort(mad_actual)

    return {
        "statistic": mad,
        "interval": (mad_actual[0], mad_actual[idx_max]),
        "p-value": 1.0 - percentileofscore(mad_actual, mad,
                                                kind="strict")/100
    }


def beta_test(calibration_map, test_type="adev", scores=None, n_curves=100,
              alpha=0.05):
    if test_type == "adev":
        return adev_test(scores, calibration_map, alpha)
    elif test_type == "madac":
        return madac_test(scores, calibration_map, n_curves, alpha)
    else:
        raise ValueError("Unknown test type. Expected 'adev' or 'madac'. Got "
                         "{}".format(test_type))


def df_normalise(df, columns=True):
    '''
    rows: bool
        Normalize each column to sum to one, or each row to sum to one
    '''
    if columns:
        return df/df.sum(axis=0)
    return (df.T/df.sum(axis=1)).T

